function App() {
  return (
    <header class="header">
      <div class="logo">
        <img src="./img/logo.png"></img>
        <h1>Share Your Route</h1>
      </div>
      <button class="btn btn-large btn-open">Share Your Route</button>
    </header>
  );
}

export default App;
